import Header from "./components/Header";
import Nav from "./components/Navigation";

import "./App.css";

function App() {
	const [navLinks] = useState(["About Me", "Portfolio", "Contact", "Resume"]);

	const [currentNavLink, setCurrentNavLink] = useState(navLinks[0]);

	return (
		<div>
			<Header>
				<Nav></Nav>
			</Header>
		</div>
	);
}

export default App;
